  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_configuracao` int(11) NOT NULL,
  `nm_view` varchar(45) NOT NULL,
  `sql_view` varchar(10000) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_sys_regra_extracao_sys_configuracao1_idx` (`id_configuracao`),
