/*Data for the table `sys_regra_extracao` */

insert  into `sys_regra_extracao`(`id`,`id_configuracao`,`nm_view`,`sql_view`) values 
(1,1,'vw_individuo_atividade','SELECT tt.id_tempo_tarefa AS id,\r\n            1 AS id_desafio,\r\n            tt.id_usuario AS id_individuo,\r\n            tt.tmp_dia_referencia AS dt_ocorrencia,\r\n            tt.qtd_tempo AS vl_atingido,\r\n            COALESCE(t_1.qtd_estimado, tt.qtd_tempo) AS vl_planejado,\r\n            NULL::character varying(100) AS sg_atingido,\r\n            NULL::character varying(100) AS sg_planejado,\r\n            NULL::timestamp without time zone AS dt_atingido,\r\n            NULL::timestamp without time zone AS dt_planejado\r\n           FROM tempo_tarefa tt\r\n             JOIN tarefa t_1 ON tt.id_tarefa = t_1.id_tarefa\r\n             JOIN tipo_tarefa tr ON t_1.id_tipo_tarefa = tr.id_tipo_tarefa AND (tr.id_tipo_tarefa = ANY (ARRAY[5, 8, 9, 24]))\r\n        UNION ALL\r\n         SELECT rh.id_registro_hora AS id,\r\n            2 AS id_desafio,\r\n            rh.id_usuario AS id_individuo,\r\n            c.dt_dia AS dt_ocorrencia,\r\n            NULL::double precision AS vl_atingido,\r\n            NULL::double precision AS vl_planejado,\r\n            NULL::character varying(100) AS sg_atingido,\r\n            NULL::character varying(100) AS sg_planejado,\r\n            to_timestamp((c.dt_dia::text || \' \'::text) || rh.tmp_manha_inicio::text, \'yyyy-MM-dd HH24:MI:SS\'::text) AS dt_atingido,\r\n            to_timestamp(c.dt_dia::text || \' 08:00\'::text, \'yyyy-MM-dd HH24:MI:SS\'::text) AS dt_planejado\r\n           FROM registro_hora rh\r\n             JOIN calendario c ON rh.id_calendario = c.id_calendario AND rh.tmp_manha_inicio IS NOT NULL AND rh.tmp_manha_fim IS NOT NULL AND rh.tmp_tarde_inicio IS NOT NULL AND rh.tmp_tarde_fim IS NOT NULL'),
(2,1,'vw_grupo_atividade','SELECT u.id_usuario AS id_individuo,\r\n            u.nm_completo AS nm_individuo,\r\n            g.id_grupo,\r\n            g.nm_grupo\r\n           FROM sis_usuario u\r\n             JOIN sis_grupo g ON u.id_grupo = g.id_grupo'),
(3,1,'vw_individuo_grupo','SELECT u.id AS id_individuo,\r\n            (btrim(u.firstname::text) || \' \'::text) || btrim(u.lastname::text) AS nm_individuo,\r\n            u.created_on AS dt_nascimento,\r\n            g.id AS id_grupo,\r\n            g.lastname AS nm_grupo\r\n           FROM users u\r\n             LEFT JOIN groups_users gu ON gu.user_id = u.id\r\n             LEFT JOIN users g ON g.id = gu.group_id AND lower(g.type::text) = \'group\'::text\r\n          WHERE lower(u.type::text) = \'user\'::text\r\n          ORDER BY u.firstname, u.lastname, g.lastname');

